/** Extract information about a Unicode character.
 *
 *  This function extracts the information about a character from the
 *  Unicode character tables.
 */
int Xapian::Unicode::Internal::get_character_info(unsigned ch) noexcept
{
	if(UNLIKELY(ch >= 0x110000)) {
		// Categorise non-Unicode values as UNASSIGNED with no case variants.
		return Xapian::Unicode::UNASSIGNED;
	}
	auto group = (pageMap[int(ch) >> OFFSET_BITS] << OFFSET_BITS) | ((ch) & ((1 << OFFSET_BITS) - 1));
	return groups[groupMap[group]];
}
